function FinishScreen({ points, maxPoints }) {
  const percentage = (points / maxPoints) * 100;
  return (
    <>
      <p className="result">
        your score is {points}/{maxPoints} ({Math.ceil(percentage)} %)
      </p>
      <p></p>
    </>
  );
}

export default FinishScreen;
